        <div className="w-80 p-2 bg-white rounded-lg absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2">
            <div className="img_container">
                <img src={require('../assets/index1.jpg')} />
            </div>
            <div className="product_info">
                <h5>Product</h5>
                <p>description</p>
                <span>price</span>
            </div>
        </div>
    )
}

export default ItemCard;
